(20, 'Gợi ý áo khoác nam cho ngày se lạnh', '<h1 class=\"title_news_detail mb10\" style=\"margin: 0px 0px 10px; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision; font: 400 28px / 32px arial; color: rgb(51, 51, 51); letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\">Gợi ý áo khoác nam cho ngày se lạnh</h1>\r\n<p class=\"description\" style=\"margin: 10px 0px; padding: 0px 0px 5px; box-sizing: border-box; text-rendering: geometricprecision; color: rgb(51, 51, 51); font: 400 14px / 18px arial; overflow: hidden; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\">Áo khoác gió, nỉ chui đầu hay áo da giúp giữ ấm, đa dạng mẫu mã, đang giảm giá sâu trên Shop VnExpress.</p>\r\n<article class=\"content_detail fck_detail width_common block_ads_connect\" style=\"margin: 0px; padding: 0px 0px 10px; box-sizing: border-box; text-rendering: geometricprecision; width: 500px; float: left; color: rgb(51, 51, 51); font-size: 14px; font-family: arial; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\">\r\n  <table align=\"center\" border=\"0\" cellpadding=\"3\" cellspacing=\"0\" class=\"tplCaption\" style=\"margin: 10px auto; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision; max-width: 100%; border-collapse: collapse; width: 500px;\">\r\n    <tbody style=\"margin: 0px; padding: 0p