e;\" target=\"_blank\">AKD018</a> có chất da mềm, độ bền cao và chống lạnh. Vải lót dù thoáng mát và ấm, hợp với mùa thu đông lẫn xuân. Phái mạnh có thể chọn một trong ba size: M (49-55 kg), L (55-66 kg), XL (67-75 kg). Sản phẩm giảm đến 30 %, còn 349.000 đồng (giá gốc 499.000 đồng), được tặng kèm một đôi tất (vớ).\r\n          </p>\r\n        </td>\r\n      </tr>\r\n    </tbody>\r\n  </table>\r\n</article>', '/image/news/1.png', '2019-12-15 00:00:00'),
(21, 'Váy dạ hội của Thùy Linh tại chung kết Miss World', '<p class=\"description\" style=\"margin: 10px 0px; padding: 0px 0px 5px; box-sizing: border-box; text-rendering: geometricprecision; color: rgb(51, 51, 51); font: 400 14px / 18px arial; overflow: hidden; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\">Lương Thùy Linh - đại diện Việt Nam - giới thiệu hai bộ váy dạ hội mà cô sẽ chọn một để diện trong chung kết 14/12 tại London (Anh).&nbsp;</p>\r\n<article class=\"content_detail fck_detail width_common block_ads_connect\" style=\"margin: 0px; padding: 0px 0px 10px; box-sizing: border-box; text-rendering: geometricprecision; width: 500px; float: left; color: rgb(51, 51, 51); font-size: 14px; font-family: arial; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\">\r\n  <p class=\"Normal\" dir=\"ltr\" style=\"margin: 0px 0px 1em; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision; font: 400 14px / 18px arial;\">Hai mẫu đầm của&nbsp;\r\n    <a href=\"https://vnexpress.net/giai-tri/10-ung-vien-cho-ngoi-hoa-hau-the-gioi-2019-4027216.html\" rel=\"dofollow\" style=\"margin: 0px; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision; color: rgb(0, 79, 139); text-decoration: none;\" target=\"_blank\">Lương Thùy Linh</a> đều có thiết kế xẻ đùi, tông màu nhã nhặn. Nhà thiết kế Lê Thanh Hòa chia sẻ anh chọn phom dáng tôn thế mạnh hình thể người mặc nhiều nhất. Phần đuôi váy không quá rườm rà, giúp đại diện Việt Nam thuận tiện hơn khi catwalk.&nbsp;\r\n  </p>\r\n  <table align=\"center\" border=\"0\" cellpadding=\"2\" cellspacing=\"0\" class=\"tplCaption\" style=\"margin: 10px auto; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision; max-width: 100%; border-collapse: collapse; width: 420px;\">\r\n    <tbody style=\"margin: 0px; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision;\">\r\n      <tr style=\"margin: 0px; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision;\">\r\n        <td style=\"margin: 0px; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision; line-height: 0; text-align: center;\">\r\n          <img alt=\"Thùy Linh diện váy xuyên thấu tôn hình thể.\" data-natural-h=\"630\" data-natural-width=\"420\" src=\"https://i-giaitri.vnecdn.net/2019/12/14/HOA-HAU-LUONG-THUY-LINH-35-JPG-1493-1576296823.jpg\" class=\"lazyInitial lazyLoaded\" data-was-processed=\"true\" data-width=\"420\" data-pwidth=\"500\" style=\"padding: 0px; box-sizing: border-box; text-rendering: geometricprecision; border: 0px; font-size: 0px; line-height: 0; max-width: 100%;\">\r\n        </td>\r\n      </tr>\r\n      <tr style=\"margin: 0px; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision;\">\r\n        <td style=\"margin: 0px; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision; line-height: 0;\">\r\n          <p class=\"Image\" style=\"margin: 0px; padding: 10px; box-sizing: border-box; text-rendering: geometricprecision; font: 400 13px / 16px arial; color: rgb(51, 51, 51); background: rgb(245, 245, 245);\">Thùy Linh diện váy xuyên thấu tôn hình thể.</p>\r\n        </td>\r\n      </tr>\r\n    </tbody>\r\n  </table>\r\n  <p class=\"Normal\" dir=\"ltr\" style=\"margin: 0px 0px 1em; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision; font: 400 14px / 18px arial;\">Chiếc đầm dạ hội trắng có chất liệu xuyên thấu, đắp hoa ren, kết hợp phần tùng xòe rộng. Bộ váy thứ hai hở một phần ngực và eo, có gam màu xanh pastel. Thiết kế được đính đá xuyên suốt, giúp người mặc tỏa sáng trên sân khấu.&nbsp;</p>\r\n  <table align=\"center\" border=\"0\" cellpadding=\"3\" cellspacing=\"0\" class=\"tplCaption\" style=\"margin: 10px auto; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision; max-width: 100%; border-collapse: collapse; width: 419px;\">\r\n    <tbody style=\"margin: 0px; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision;\">\r\n      <tr style=\"margin: 0px; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision;\">\r\n        <td style=\"margin: 0px; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision; line-height: 0;\">\r\n          <img alt=\"Xanh dương và trắng là gam màu được yêu thích nhất ở Miss World. Ảnh: S.V.&nbsp;\" data-natural-h=\"630\" data-natural-width=\"419\" src=\"https://i-giaitri.vnecdn.net/2019/12/14/HOA-HAU-LUONG-THUY-LINH-15-JPG-4954-1576296822.jpg\" class=\"lazyInitial lazyLoaded\" data-was-processed=\"true\" data-width=\"419\" data-pwidth=\"500\" style=\"padding: 0px; box-sizing: border-box; text-rendering: geometricprecision; border: 0px; font-size: 0px; line-height: 0; max-width: 100%;\">\r\n        </td>\r\n      </tr>\r\n      <tr style=\"margin: 0px; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision;\">\r\n        <td style=\"margin: 0px; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision; line-height: 0;\">\r\n          <p class=\"Image\" style=\"margin: 0px; padding: 10px; box-sizing: border-box; text-rendering: geometricprecision; font: 400 13px / 16px arial; color: rgb(51, 51, 51); background: rgb(245, 245, 245);\">Xanh dương và trắng là gam màu được yêu thích nhất ở Miss World. Ảnh: S.V.&nbsp;</p>\r\n        </td>\r\n      </tr>\r\n    </tbody>\r\n  </table>\r\n  <p class=\"Normal\" dir=\"ltr\" style=\"margin: 0px 0px 1em; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision; font: 400 14px / 18px arial;\">Thùy Linh cho biết cô giữ tâm lý thoải mái và tự tin, sẵn sàng \"chiến đấu\" hết mình. Cô nằm trong tốp&nbsp;thí sinh có phong độ tốt, là ứng viên sáng giá của ngôi hoa hậu. Trước chung kết, Thùy Linh ghi điểm ở các phần thi phụ như: về nhì Top Model,&nbsp;\r\n    <a href=\"https://vnexpress.net/giai-tri/du-an-nhan-ai-cua-thuy-linh-vao-top-10-miss-world-4025666.html\" rel=\"dofollow\" style=\"margin: 0px; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision; color: rgb(0, 79, 139); text-decoration: none;\">Top 10</a> Người đẹp Nhân ái, được đánh giái cao trong phần thi Head to Head. Đại diện Việt Nam được chuyên trang sắc đẹp <em style=\"margin: 0px; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision;\">Angelopedia</em> đánh giá cao vì có khuôn mặt xinh đẹp và phong cách thanh lịch.</p>\r\n  <p dir=\"ltr\" style=\"margin: 0px 0px 1em; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision; font: 400 14px / 18px arial;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision; color: rgb(0, 0, 0);\">Lương Thùy Linh sinh năm 2000, quê Cao Bằng, đang là sinh viên Đại học Ngoại thương Hà Nội. Người đẹp cao 1,77 m và có số đo cơ thể 89-64-92 cm, đôi chân dài 1,22 m. Thùy Linh cũng gây ấn tượng với khả năng tiếng Anh, đạt 7,5 điểm IELTS</span><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision; color: rgb(0, 0, 0);\">.</span></p>\r\n  <figure class=\"item_slide_show clearfix\" style=\"margin: 0px auto 20px; padding: 0px; box-sizing: border-box; text-rendering: geometricprecision; width: auto; max-width: 100%; overflow: hidden; clear: both;\">\r\n    <div class=\"box_embed_video_parent embed_video_new\" data-ads=\"1\" data-aot=\"Thùy Linh được khen hoàn hảo khi thi vấn đáp\" data-articleoriginal=\"4022706\" data-auto=\"1\" data-brandsafe=\"0\" data-duration=\"206\" data-frame=\"\" data-initdom=\"1\" da